    hy: "Հետազոտողը խնդրում է, որ տրամադրեք ձեր EasyEyes ID-ն նախորդ նիստից, խնդրում ենք մուտքագրել այն այստեղ կամ վերբեռնել ներբեռնված ֆայլը, երբ վերջին նիստն ավարտվի:",
    bg: "Изследователят изисква да предоставите вашия EasyEyes ID от предишната сесия, моля, въведете го тук или качете изтегления файл, когато последната сесия приключи.",
    "zh-CN":
      "研究人员要求您提供上一次会话中的 EasyEyes ID，请在此处输入，或上传上一次会话结束时下载的文件。",
    "zh-HK":
      "研究人員要求您提供上一次會話中的 EasyEyes ID，請在此輸入，或上傳上一次會話結束時下載的檔案。",
    hr: "Istraživač traži da navedete svoj EasyEyes ID iz prethodne sesije, upišite ga ovdje ili prenesite datoteku preuzetu po završetku posljednje sesije.",
    cs: "Výzkumník vás žádá, abyste uvedli své ID EasyEyes z předchozí relace, zadejte jej sem nebo nahrajte soubor stažený po skončení poslední relace.",
