    ja: "研究者は、前のセッションの EasyEyes ID を提供するよう要求します。ここに入力するか、最後のセッションの終了時にダウンロードしたファイルをアップロードしてください。",
    kn: "ಹಿಂದಿನ ಸೆಶನ್‌ನಿಂದ ನಿಮ್ಮ EasyEyes ID ಅನ್ನು ನೀವು ಒದಗಿಸುವಂತೆ ಸಂಶೋಧಕರು ವಿನಂತಿಸುತ್ತಾರೆ, ದಯವಿಟ್ಟು ಅದನ್ನು ಇಲ್ಲಿ ಟೈಪ್ ಮಾಡಿ ಅಥವಾ ಕೊನೆಯ ಸೆಷನ್‌ ಮುಗಿದಾಗ ಡೌನ್‌ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್ ಅನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಿ.",
    ko: "연구원은 이전 세션에서 EasyEyes ID를 제공하도록 요청합니다. 여기에 입력하거나 마지막 세션이 끝나면 다운로드한 파일을 업로드하십시오.",
    lt: "Tyrėjas prašo pateikti savo EasyEyes ID iš ankstesnės sesijos, įveskite jį čia arba įkelkite failą, atsisiųstą, kai baigsis paskutinė sesija.",
    ms: "Penyelidik meminta anda memberikan ID EasyEyes anda dari sesi sebelumnya, sila taipkannya di sini atau muat naik fail yang dimuat turun apabila sesi terakhir tamat.",
    ml: "മുമ്പത്തെ സെഷനിൽ നിന്ന് നിങ്ങളുടെ EasyEyes ഐഡി നൽകണമെന്ന് ഗവേഷകൻ അഭ്യർത്ഥിക്കുന്നു, ദയവായി അത് ഇവിടെ ടൈപ്പ് ചെയ്യുക അല്ലെങ്കിൽ അവസാന സെഷൻ അവസാനിക്കുമ്പോൾ ഡൗൺലോഡ് ചെയ്ത ഫയൽ അപ്‌ലോഡ് ചെയ്യുക.",
    no: "Forskeren ber om at du oppgir din EasyEyes-ID fra forrige økt, skriv den inn her, eller last opp filen som er lastet ned når den siste økten avsluttes.",
