    pl: "Badacz prosi o podanie identyfikatora EasyEyes z poprzedniej sesji. Wpisz go tutaj lub prześlij plik pobrany po zakończeniu ostatniej sesji.",
    pt: "O pesquisador solicita que você forneça seu ID EasyEyes da sessão anterior, digite-o aqui, ou carregue o arquivo baixado quando a última sessão terminar.",
    ro: "Cercetatorul vă solicită să furnizați ID-ul EasyEyes din sesiunea anterioară, vă rugăm să-l introduceți aici sau să încărcați fișierul descărcat când se termină ultima sesiune.",
    ru: "Исследователь просит вас предоставить свой идентификатор EasyEyes из предыдущего сеанса. Введите его здесь или загрузите файл, загруженный после завершения последнего сеанса.",
    sr: "Истраживач захтева да доставите свој ЕасиЕиес ИД из претходне сесије, унесите га овде или отпремите преузету датотеку када се последња сесија заврши.",
    es: "El investigador solicita que proporciones tu ID de EasyEyes de la sesión anterior, por favor escríbelo aquí o sube el archivo descargado cuando terminó la última sesión.",
    sw: "Mtafiti anaomba utoe kitambulisho chako cha EasyEyes kutoka kwa kipindi kilichopita, tafadhali kichape hapa, au pakia faili iliyopakuliwa kipindi cha mwisho kinapoisha.",
    sv: "Forskaren ber dig att tillhandahålla ditt EasyEyes-ID från föregående session, vänligen skriv det här eller ladda upp filen som laddats ner när den senaste sessionen slutar.",
    tl: "Hinihiling ng mananaliksik na ibigay mo ang iyong EasyEyes ID mula sa nakaraang session, paki-type ito dito, o i-upload ang file na na-download kapag natapos ang huling session.",
