    bg: "❌ НЕСЪВМЕСТИМО. съжалявам Можете да опитате друг браузър, или компютър, или каквото и да е съвместимо. В противен случай натиснете CANCEL, за да върнете това изследване на Prolific.com.",
    "zh-CN":
      "❌ 不兼容。对不起。欢迎您尝试其他浏览器、计算机或任何可能兼容的设备。否则，请点击“取消”将此研究返回到 Prolific.com。",
    "zh-HK":
      "❌ 不相容。對不起。歡迎您嘗試其他瀏覽器、電腦或任何可能相容的裝置。否則，請點擊「取消」將此研究返回 Prolific.com。",
    hr: "❌ NESPOJIVO. oprosti Slobodno isprobajte neki drugi preglednik, računalo ili bilo što drugo koje bi moglo biti kompatibilno. U suprotnom pritisnite CANCEL da vratite ovu studiju na Prolific.com.",
    cs: "❌ NEKOMPATIBILNÍ. promiň. Můžete zkusit jiný prohlížeč, počítač nebo cokoli, co by mohlo být kompatibilní. V opačném případě stiskněte ZRUŠIT pro návrat této studie na Prolific.com.",
    da: "❌ INKOMPATIBEL. Undskyld. Du er velkommen til at prøve en anden browser eller computer, eller hvad der nu er kompatibelt. Ellers tryk på CANCEL for at returnere denne undersøgelse til Prolific.com.",
    nl: "❌ ONVERENIGBAAR. Sorry. U bent van harte welkom om een ​​andere browser, of computer, of wat dan ook compatibel is, te proberen. Anders klikt u op ANNULEREN om dit onderzoek terug te sturen naar Prolific.com.",
    "en-UK":
      "❌ INCOMPATIBLE. Sorry. You're welcome to try another browser, or computer, or whatever might be compatible. Otherwise hit CANCEL to return this study to Prolific.com.",
    fi: "❌ YHTEENSOPImaton. Anteeksi. Voit kokeilla toista selainta, tietokonetta tai mitä tahansa yhteensopivaa. Muussa tapauksessa paina CANCEL palauttaaksesi tämän tutkimuksen Prolific.com-sivustolle.",
    fr: "❌ INCOMPATIBLE. Désolé. Vous êtes invité à essayer un autre navigateur, un autre ordinateur, ou tout ce qui pourrait être compatible. Sinon, appuyez sur ANNULER pour retourner à Prolific.com.",
    de: "❌ INKOMPATIBEL. Entschuldigung. Sie können gerne einen anderen Browser, Computer oder was auch immer kompatibel sein könnte, ausprobieren. Andernfalls klicken Sie auf ABBRECHEN, um diese Studie an Prolific.com zurückzusenden.",
    el: "❌ ΑΣΥΜΒΑΤΟ. Συγνώμη. Μπορείτε να δοκιμάσετε άλλο πρόγραμμα περιήγησης, υπολογιστή ή οτιδήποτε άλλο μπορεί να είναι συμβατό. Διαφορετικά, πατήστε ΑΚΥΡΩΣΗ για να επιστρέψετε αυτήν τη μελέτη στο Prolific.com.",
    he: "❌ לא תואם. מִצטַעֵר. אתה מוזמן לנסות דפדפן אחר, או מחשב אחר, או כל דבר אחר שעשוי להיות תואם. אחרת, לחץ על ביטול כדי להחזיר את המחקר הזה ל-Prolific.com.",
    hi: "❌ असंगत। क्षमा मांगना। किसी अन्य ब्राउज़र, या कंप्यूटर, या जो भी संगत हो, उसे आज़माने के लिए आपका स्वागत है। अन्यथा इस अध्ययन को Prolific.com पर वापस करने के लिए CANCEL दबाएँ।",
    hu: "❌ INKOMPATIBÁLIS. Elnézést. Szívesen próbáljon ki egy másik böngészőt, számítógépet vagy bármit, ami kompatibilis. Ellenkező esetben nyomja meg a MÉGSE gombot, hogy visszaküldje ezt a tanulmányt a Prolific.com webhelyre.",
    is: "❌ Ósamrýmanlegt. Því miður. Þér er velkomið að prófa annan vafra, eða tölvu, eða hvað sem gæti verið samhæft. Annars smelltu á CANCEL til að skila þessari rannsókn á Prolific.com.",
    id: "❌ TIDAK SESUAI. Maaf. Anda boleh mencoba browser lain, atau komputer, atau apa pun yang mungkin kompatibel. Jika tidak, tekan BATAL untuk mengembalikan studi ini ke Prolific.com.",
    it: "❌ INCOMPATIBILE. Mi dispiace. Sei invitato a provare un altro browser, o computer, o qualsiasi cosa possa essere compatibile. Altrimenti premi ANNULLA per tornare a Prolific.com.",
    ja: "❌ 互換性がありません。ごめん。別のブラウザやコンピュータなど、互換性のあるものを試してみてください。それ以外の場合は、[キャンセル] をクリックしてこの研究を Prolific.com に戻します。",
    kn: "❌ ಹೊಂದಾಣಿಕೆಯಾಗುವುದಿಲ್ಲ. ಕ್ಷಮಿಸಿ. ಇನ್ನೊಂದು ಬ್ರೌಸರ್, ಅಥವಾ ಕಂಪ್ಯೂಟರ್ ಅಥವಾ ಯಾವುದಾದರೂ ಹೊಂದಾಣಿಕೆಯನ್ನು ಪ್ರಯತ್ನಿಸಲು ನಿಮಗೆ ಸ್ವಾಗತ. ಇಲ್ಲವಾದರೆ ಈ ಅಧ್ಯಯನವನ್ನು Prolific.com ಗೆ ಹಿಂತಿರುಗಿಸಲು CANCEL ಅನ್ನು ಒತ್ತಿರಿ.",
