    lt: "❌ NESUDERINAMAS. Atsiprašau. Kviečiame išbandyti kitą naršyklę, kompiuterį ar bet ką, kas gali būti suderinama. Kitu atveju paspauskite ATŠAUKTI, kad grąžintumėte šį tyrimą į Prolific.com.",
    ms: "❌ TAK SESUAI. Maaf. Anda dialu-alukan untuk mencuba pelayar lain, atau komputer, atau apa sahaja yang mungkin serasi. Jika tidak, tekan CANCEL untuk mengembalikan kajian ini kepada Prolific.com.",
    ml: "❌ പൊരുത്തമില്ലാത്തത്. ക്ഷമിക്കണം. മറ്റൊരു ബ്രൗസർ, അല്ലെങ്കിൽ കമ്പ്യൂട്ടർ, അല്ലെങ്കിൽ അനുയോജ്യമായ മറ്റെന്തെങ്കിലും പരീക്ഷിക്കാൻ നിങ്ങൾക്ക് സ്വാഗതം. അല്ലെങ്കിൽ ഈ പഠനം Prolific.com-ലേക്ക് തിരികെ നൽകാൻ CANCEL അമർത്തുക.",
    no: "❌ INKOMPATIBEL. Beklager. Du er velkommen til å prøve en annen nettleser, eller datamaskin, eller hva som måtte være kompatibelt. Ellers trykk AVBRYT for å returnere denne studien til Prolific.com.",
    fa: "❌ ناسازگار. متاسفم می توانید مرورگر یا رایانه دیگری یا هر چیزی که ممکن است سازگار باشد را امتحان کنید. در غیر این صورت CANCEL را بزنید تا این مطالعه به Prolific.com برگردد.",
    pl: "❌ NIEKOMPATYBILNY. Przepraszam. Możesz wypróbować inną przeglądarkę, komputer lub cokolwiek innego, co może być kompatybilne. W przeciwnym razie naciśnij ANULUJ, aby zwrócić to badanie do Prolific.com.",
    pt: "❌INCOMPATÍVEL. Desculpe. Você pode tentar outro navegador, ou computador, ou qualquer outro que seja compatível. Caso contrário, clique em CANCELAR para devolver este estudo ao Prolific.com.",
    ro: "❌ INCOMPATIBIL. Îmi pare rău. Sunteți binevenit să încercați alt browser, sau computer sau orice ar putea fi compatibil. În caz contrar, apăsați CANCEL pentru a returna acest studiu la Prolific.com.",
    ru: "❌НЕСОВМЕСТИМОСТЬ. Извини. Вы можете попробовать другой браузер, компьютер или что-то еще, что может быть совместимо. В противном случае нажмите «ОТМЕНА», чтобы вернуть это исследование на Prolific.com.",
    sr: "❌ НЕКОМПАТИБИЛНО. Извините. Можете испробати други прегледач, рачунар или било шта друго компатибилно. У супротном притисните Откажи да бисте ову студију вратили на Пролифиц.цом.",
    es: "❌ INCOMPATIBLE. Lo siento. Puedes intentar con otro navegador, o computadora, o lo que sea compatible. De lo contrario, presiona CANCELAR para regresar a este estudio en Prolific.com.",
    sw: "❌ HAIWEZEKANI. Pole. Unakaribishwa kujaribu kivinjari kingine, au kompyuta, au chochote kinachoweza kutumika. Vinginevyo gonga CANCEL ili kurudisha utafiti huu kwa Prolific.com.",
    sv: "❌ INKOMPATIBEL. Ledsen. Du är välkommen att prova en annan webbläsare, eller dator, eller vad som kan vara kompatibelt. Annars tryck på AVBRYT för att returnera denna studie till Prolific.com.",
    tl: "❌ INCOMPATible. Paumanhin. Maaari kang sumubok ng isa pang browser, o computer, o anumang maaaring magkatugma. Kung hindi, pindutin ang CANCEL upang ibalik ang pag-aaral na ito sa Prolific.com.",
    tr: "❌ UYUMSUZ. Üzgünüm. Başka bir tarayıcıyı, bilgisayarı veya uyumlu olabilecek herhangi bir şeyi deneyebilirsiniz. Aksi halde bu çalışmayı Prolific.com'a geri göndermek için İPTAL'e basın.",
    ur: "❌ غیر مطابقت پذیر۔ معذرت آپ کو کوئی دوسرا براؤزر، یا کمپیوٹر، یا جو کچھ بھی ہم آہنگ ہو، آزمانے کا خیرمقدم ہے۔ بصورت دیگر اس مطالعہ کو Prolific.com پر واپس کرنے کے لیے CANCEL کو دبائیں۔",
