    fr: "Vos yeux sont à 111 cm de l'écran, mais l'expérience nécessite 222 cm. L'expérience reprendra lorsque vous atteindrez la distance correcte.",
    de: "Ihre Augen sind 111 cm vom Bildschirm entfernt, aber das Experiment benötigt 222 cm. Das Experiment wird fortgesetzt, wenn Sie den richtigen Abstand erreicht haben.",
    el: "Τα μάτια σας απέχουν 111 cm από την οθόνη, αλλά το πείραμα χρειάζεται 222 cm. Το πείραμα θα συνεχιστεί όταν φτάσετε στη σωστή απόσταση.",
    he: 'העיניים שלך מרוחקות 111 ס"מ מהמסך, אבל הניסוי צריך 222 ס"מ. הניסוי יתחדש כאשר תגיע למרחק הנכון.',
    hi: "आपकी आँखें स्क्रीन से 111 सेमी दूर हैं, लेकिन प्रयोग के लिए 222 सेमी की आवश्यकता है। जब आप सही दूरी पर पहुंच जाएंगे तो प्रयोग फिर से शुरू हो जाएगा।",
    hu: "A szeme 111 cm-re van a képernyőtől, de a kísérlethez 222 cm-re van szüksége. A kísérlet akkor folytatódik, ha eléri a megfelelő távolságot.",
