    it: "I tuoi occhi sono a 111 cm dallo schermo, ma l'esperimento richiede 222 cm. L'esperimento riprenderà quando raggiungerai la distanza corretta.",
    ja: "目は画面から 111 cm 離れていますが、実験には 222 cm 必要です。正しい距離に到達すると実験が再開されます。",
