    ko: "당신의 눈은 화면에서 111cm 떨어져 있지만 실험에는 222cm가 필요합니다. 올바른 거리에 도달하면 실험이 재개됩니다.",
    lt: "Jūsų akys yra 111 cm atstumu nuo ekrano, bet eksperimentui reikia 222 cm. Eksperimentas bus tęsiamas, kai pasieksite reikiamą atstumą.",
    ms: "Mata anda adalah 111 cm dari skrin, tetapi eksperimen memerlukan 222 cm. Percubaan akan disambung semula apabila anda mencapai jarak yang betul.",
    ml: "നിങ്ങളുടെ കണ്ണുകൾ സ്ക്രീനിൽ നിന്ന് 111 സെൻ്റീമീറ്റർ അകലെയാണ്, പക്ഷേ പരീക്ഷണത്തിന് 222 സെൻ്റീമീറ്റർ ആവശ്യമാണ്. നിങ്ങൾ ശരിയായ ദൂരത്തിൽ എത്തുമ്പോൾ പരീക്ഷണം പുനരാരംഭിക്കും.",
    no: "Øynene dine er 111 cm fra skjermen, men eksperimentet trenger 222 cm. Eksperimentet vil gjenopptas når du når riktig avstand.",
    fa: "چشمان شما 111 سانتی متر از صفحه نمایش فاصله دارد، اما آزمایش به 222 سانتی متر نیاز دارد. زمانی که به فاصله صحیح برسید، آزمایش از سر گرفته می شود.",
    pl: "Twoje oczy znajdują się w odległości 111 cm od ekranu, ale do eksperymentu potrzeba 222 cm. Eksperyment zostanie wznowiony, gdy osiągniesz odpowiednią odległość.",
    pt: "Seus olhos estão a 111 cm da tela, mas o experimento precisa de 222 cm. O experimento será retomado quando você atingir a distância correta.",
