    ru: "Ваши глаза находятся на расстоянии 111 см от экрана, а для эксперимента нужно 222 см. Эксперимент возобновится, когда вы достигнете правильного расстояния.",
    sr: "Ваше очи су удаљене 111 цм од екрана, али за експеримент је потребно 222 цм. Експеримент ће се наставити када достигнете тачну удаљеност.",
    es: "Tus ojos están a 111 cm de la pantalla, pero el experimento necesita 222 cm. El experimento se reanudará cuando alcances la distancia correcta.",
    sw: "Macho yako yako sentimita 111 kutoka skrini, lakini jaribio linahitaji sentimita 222. Jaribio litaendelea utakapofika umbali sahihi.",
    sv: "Dina ögon är 111 cm från skärmen, men experimentet behöver 222 cm. Experimentet kommer att återupptas när du når rätt avstånd.",
