    hr: "Za brzu provjeru komunikacije, usmjerite kameru svog telefona prema QR kodu ispod i dodirnite vezu koja se pojavljuje na zaslonu vašeg telefona.",
    cs: "Pro rychlou kontrolu komunikace namiřte fotoaparát telefonu na QR kód níže a klepněte na odkaz, který se zobrazí na obrazovce telefonu.",
    da: "For et hurtigt kommunikationstjek skal du pege din telefons kamera mod QR-koden nedenfor og trykke på linket, der vises på din telefons skærm.",
    nl: "Voor een snelle communicatiecontrole richt u de camera van uw telefoon op de onderstaande QR-code en tikt u op de link die op het scherm van uw telefoon verschijnt.",
    "en-UK":
      "For a quick communication check, point your phone's camera at the QR code below and tap the link that appears on your phone's screen.",
    fi: "Voit tarkistaa viestinnän nopeasti osoittamalla puhelimen kameran alla olevaan QR-koodiin ja napauttamalla linkkiä, joka tulee näkyviin puhelimen näytölle.",
    fr: "Pour une vérification rapide de la communication, pointez l'appareil photo de votre téléphone vers le code QR ci-dessous et appuyez sur le lien qui apparaît sur l'écran de votre téléphone.",
    de: "Für eine schnelle Kommunikationsprüfung richten Sie die Kamera Ihres Telefons auf den QR-Code unten und tippen Sie auf den Link, der auf dem Bildschirm Ihres Telefons angezeigt wird.",
    el: "Για έναν γρήγορο έλεγχο επικοινωνίας, στρέψτε την κάμερα του τηλεφώνου σας στον παρακάτω κωδικό QR και πατήστε τον σύνδεσμο που εμφανίζεται στην οθόνη του τηλεφώνου σας.",
    he: "לבדיקת תקשורת מהירה, כוון את מצלמת הטלפון שלך אל קוד ה-QR למטה והקש על הקישור שמופיע במסך הטלפון שלך.",
    hi: "त्वरित संचार जांच के लिए, अपने फ़ोन के कैमरे को नीचे दिए गए QR कोड पर इंगित करें और अपने फ़ोन की स्क्रीन पर दिखाई देने वाले लिंक पर टैप करें।",
    hu: "A kommunikáció gyors ellenőrzéséhez irányítsa telefonja kameráját az alábbi QR-kódra, és koppintson a telefon képernyőjén megjelenő hivatkozásra.",
    is: "Til að athuga samskiptin fljótt skaltu beina myndavél símans að QR kóðanum hér að neðan og smella á tengilinn sem birtist á skjá símans.",
    id: "Untuk pemeriksaan komunikasi cepat, arahkan kamera ponsel Anda ke kode QR di bawah dan ketuk tautan yang muncul di layar ponsel Anda.",
    it: "Per un rapido controllo della comunicazione, punta la fotocamera del tuo telefono sul codice QR qui sotto e tocca il link che appare sullo schermo del tuo telefono.",
    ja: "簡単な通信チェックを行うには、携帯電話のカメラを下の QR コードに向けて、携帯電話の画面に表示されるリンクをタップします。",
    kn: "ತ್ವರಿತ ಸಂವಹನ ಪರಿಶೀಲನೆಗಾಗಿ, ಕೆಳಗಿನ QR ಕೋಡ್‌ನಲ್ಲಿ ನಿಮ್ಮ ಫೋನ್‌ನ ಕ್ಯಾಮರಾವನ್ನು ಪಾಯಿಂಟ್ ಮಾಡಿ ಮತ್ತು ನಿಮ್ಮ ಫೋನ್‌ನ ಪರದೆಯಲ್ಲಿ ಗೋಚರಿಸುವ ಲಿಂಕ್ ಅನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ.",
    ko: "빠른 통신 확인을 위해 휴대폰 카메라를 아래 QR 코드에 대고 휴대폰 화면에 나타나는 링크를 탭하세요.",
    lt: "Norėdami greitai patikrinti ryšį, nukreipkite telefono kamerą į toliau pateiktą QR kodą ir bakstelėkite telefono ekrane rodomą nuorodą.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "ദ്രുത ആശയവിനിമയ പരിശോധനയ്ക്കായി, നിങ്ങളുടെ ഫോണിൻ്റെ ക്യാമറ ചുവടെയുള്ള QR കോഡിലേക്ക് പോയിൻ്റ് ചെയ്‌ത് നിങ്ങളുടെ ഫോണിൻ്റെ സ്‌ക്രീനിൽ ദൃശ്യമാകുന്ന ലിങ്കിൽ ടാപ്പ് ചെയ്യുക.",
    no: "For en rask kommunikasjonssjekk, pek telefonens kamera mot QR-koden nedenfor og trykk på koblingen som vises på telefonens skjerm.",
