    ar: "دعونا نبحث في مكتبة الملفات الشخصية عن ملف يتطابق مع ميكروفون هاتفك. وجه كاميرا هاتفك نحو رمز الاستجابة السريعة أدناه واضغط على الرابط الذي يظهر على شاشة هاتفك.",
