    fr: "Consultons la bibliothèque de profils pour en trouver un qui corresponde au microphone de votre téléphone. Pointez l'appareil photo de votre téléphone vers le code QR ci-dessous et appuyez sur le lien qui apparaît sur l'écran de votre téléphone.",
