    hi: "आइए प्रोफ़ाइल लाइब्रेरी में वह खोजें जो आपके फ़ोन के माइक्रोफ़ोन से मेल खाती हो। अपने फ़ोन के कैमरे को नीचे दिए गए QR कोड पर इंगित करें और अपने फ़ोन की स्क्रीन पर दिखाई देने वाले लिंक पर टैप करें।",
    hu: "Nézzük meg a profilkönyvtárban azt, amelyik megfelel a telefon mikrofonjának. Irányítsa telefonjának kameráját az alábbi QR-kódra, és koppintson a telefon képernyőjén megjelenő hivatkozásra.",
    is: "Við skulum leita í prófílsafninu fyrir einn sem passar við hljóðnema símans þíns. Beindu myndavél símans að QR kóðanum hér að neðan og pikkaðu á hlekkinn sem birtist á skjá símans þíns.",
