  RC_usbMicrophoneInstructions: {
    "en-US":
      '1. If a pop up appears, asking for your permission to use the microphone, click "Allow".\n2. Click "Proceed" or hit RETURN.',
    ar: '1. إذا ظهرت نافذة منبثقة تطلب إذنك لاستخدام الميكروفون، انقر على "السماح".\n2. انقر على "متابعة" أو اضغط على RETURN.',
    hy: "1. Եթե հայտնվի թռուցիկ, որը խնդրում է ձեր թույլտվությունը օգտագործել խոսափողը, սեղմեք «Թույլատրել»:\n2. Սեղմեք «Շարունակել» կամ սեղմել RETURN:",
    bg: "1. Ако се появи изскачащ прозорец с искане за разрешение за използване на микрофона, щракнете върху „Разрешаване“.\n2. Щракнете върху „Напред“ или натиснете RETURN.",
    "zh-CN":
      "1. 如果出现弹出窗口，询问您是否允许使用麦克风，请单击“允许”。\n2. 单击“继续”或按“返回”。",
    "zh-HK":
      "1. 如果出現彈出窗口，詢問您是否允許使用麥克風，請按一下「允許」。\n2. 按一下「繼續」或按「返回」。",
    hr: '1. Ako se pojavi skočni prozor koji traži vaše dopuštenje za korištenje mikrofona, kliknite "Dopusti".\n2. Pritisnite "Nastavi" ili pritisnite POVRATAK.',
    cs: '1. Pokud se objeví vyskakovací okno s žádostí o povolení používat mikrofon, klikněte na „Povolit“.\n2. Klikněte na "Pokračovat" nebo stiskněte RETURN.',
    da: '1. Hvis der vises en pop op, hvor du beder om din tilladelse til at bruge mikrofonen, skal du klikke på "Tillad".\n2. Klik på "Fortsæt" eller tryk på RETURN.',
    nl: '1. Als er een pop-up verschijnt waarin u om toestemming wordt gevraagd om de microfoon te gebruiken, klikt u op "Toestaan".\n2. Klik op "Doorgaan" of druk op RETURN.',
    "en-UK":
      '1. If a pop-up appears, asking for your permission to use the microphone, click "Allow".\n2. Click "Proceed" or press RETURN.',
    fi: '1. Jos näkyviin tulee ponnahdusikkuna, joka pyytää lupaasi käyttää mikrofonia, napsauta "Salli".\n2. Napsauta "Jatka" tai paina PALAA.',
    fr: '1. Si une fenêtre contextuelle apparaît, demandant votre permission d\'utiliser le microphone, cliquez sur "Autoriser".\n2. Cliquez sur "Continuer" ou appuyez sur ENTRÉE.',
    de: '1. Wenn ein Pop -up angezeigt wird, klicken Sie auf "Erlauben".\n2. Klicken Sie auf "Fahren" oder klicken Sie auf die Rückgabe.',
    el: '1. Εάν εμφανιστεί ένα αναδυόμενο παράθυρο, που ζητά την άδειά σας για χρήση του μικροφώνου, κάντε κλικ στο "Να επιτρέπεται".\n2. Κάντε κλικ στο "Συνέχεια" ή πατήστε RETURN.',
    he: '1. אם מופיע חלון קופץ המבקש את רשותך להשתמש במיקרופון, לחץ על "אפשר".\n2. לחץ על "המשך" או הקש על RETURN.',
    hi: '1. यदि एक पॉप अप प्रकट होता है, जो आपसे माइक्रोफ़ोन का उपयोग करने की अनुमति मांगता है, तो "अनुमति दें" पर क्लिक करें।\n2. "आगे बढ़ें" पर क्लिक करें या रिटर्न दबाएँ।',
    hu: '1. Ha megjelenik egy előugró ablak, amely engedélyt kér a mikrofon használatához, kattintson az "Engedélyezés" gombra.\n2. Kattintson a "Tovább" gombra, vagy nyomja meg a RETURN gombot.',
    is: '1. Ef sprettigluggi birtist þar sem þú biður um leyfi til að nota hljóðnemann skaltu smella á "Leyfa".\n2. Smelltu á "Áfram" eða ýttu á TILBAKA.',
    id: '1. Jika muncul pop up yang meminta izin Anda untuk menggunakan mikrofon, klik "Izinkan".\n2. Klik "Lanjutkan" atau tekan KEMBALI.',
    it: '1. Se appare un pop-up che chiede il permesso di utilizzare il microfono, fai clic su "Consenti".\n2. Fai clic su "Procedi" o premi INVIO.',
    ja: "1. マイクの使用許可を求めるポップアップが表示された場合は、「許可」をクリックします。\n2. [続行] をクリックするか、Return キーを押します。",
    kn: '1. ಮೈಕ್ರೊಫೋನ್ ಬಳಸಲು ನಿಮ್ಮ ಅನುಮತಿಯನ್ನು ಕೇಳುವ ಪಾಪ್ ಅಪ್ ಕಾಣಿಸಿಕೊಂಡರೆ, "ಅನುಮತಿಸು" ಕ್ಲಿಕ್ ಮಾಡಿ.\n2. "ಮುಂದುವರಿಯಿರಿ" ಕ್ಲಿಕ್ ಮಾಡಿ ಅಥವಾ ಹಿಂತಿರುಗಿ ಒತ್ತಿರಿ.',
    ko: "1. 마이크 사용 권한을 묻는 팝업창이 나타나면 '허용'을 클릭하세요.\n2. \"계속\"을 클릭하거나 RETURN을 누르세요.",
    lt: "1. Jei pasirodys iššokantis langas, kuriame prašoma leidimo naudoti mikrofoną, spustelėkite „Leisti“.\n2. Spustelėkite „Tęsti“ arba paspauskite GRĮŽTI.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: '1. മൈക്രോഫോൺ ഉപയോഗിക്കുന്നതിന് നിങ്ങളുടെ അനുവാദം ചോദിക്കുന്ന ഒരു പോപ്പ് അപ്പ് ദൃശ്യമാകുകയാണെങ്കിൽ, "അനുവദിക്കുക" ക്ലിക്ക് ചെയ്യുക.\n2. "തുടരുക" ക്ലിക്ക് ചെയ്യുക അല്ലെങ്കിൽ റിട്ടേൺ അമർത്തുക.',
    no: '1. Hvis et popup-vindu dukker opp der du ber om tillatelse til å bruke mikrofonen, klikker du på "Tillat".\n2. Klikk "Fortsett" eller trykk RETURN.',
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "1. Jeśli pojawi się wyskakujące okienko z prośbą o pozwolenie na użycie mikrofonu, kliknij „Zezwalaj”.\n2. Kliknij „Kontynuuj” lub naciśnij POWRÓT.",
    pt: "1. Caso apareça um pop-up solicitando sua permissão para usar o microfone, clique em “Permitir”.\n2. Clique em “Continuar” ou pressione RETURN.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: '1. Si aparece una ventana emergente pidiendo tu permiso para usar el micrófono, haz clic en "Permitir".\n2. Haz clic en "Continuar" o presiona RETURN.',
    sw: '1. Ikiwa pop up inaonekana, kuomba ruhusa yako ya kutumia kipaza sauti, bofya "Ruhusu".\n2. Bonyeza "Endelea" au gonga RETURN.',
    sv: '1. Om ett popup-fönster visas och ber om din tillåtelse att använda mikrofonen, klicka på "Tillåt".\n2. Klicka på "Fortsätt" eller tryck på RETURN.',
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
    tr: '1. Mikrofonu kullanmak için izninizi isteyen bir açılır pencere görünürse "İzin Ver"i tıklayın.\n2. "Devam Et"e tıklayın veya GERİ DÖN\'e basın.',
    ur: '1. اگر ایک پاپ اپ ظاہر ہوتا ہے، آپ سے مائیکروفون استعمال کرنے کی اجازت طلب کرتے ہوئے، "اجازت دیں" پر کلک کریں۔\n2. "آگے بڑھیں" پر کلک کریں یا واپسی کو دبائیں۔',
  },
