      "DO NOT DISTURB. Avoid unwanted sounds and interruption of this study.\n      Macintosh: Control Center icon: 🟰 > Focus > Do Not Disturb\n     ⊞ Windows: Start  > Settings  > System  > Notifications > Do not disturb",
    ar: "لا تزعج. تجنب الأصوات غير المرغوب فيها ومقاطعة هذه الدراسة.  ماكنتوش: أيقونة مركز التحكم: 🟰 > التركيز > عدم الإزعاج ⊞ ويندوز: ابدأ > الإعدادات > النظام > الإشعارات > عدم الإزعاج",
    hy: "ՄԻ ԽԱՆԳԱՐԵՔ. Խուսափեք անցանկալի հնչյուններից և այս ուսումնասիրության ընդհատումից:\n      Macintosh: Կառավարման կենտրոնի պատկերակ.\n     ⊞ Windows. Սկսել  > Կարգավորումներ  > Համակարգ  > Ծանուցումներ > Չանհանգստացնել",
    bg: "НЕ БЕЗПОКОЯВАЙТЕ. Избягвайте нежелани звуци и прекъсване на това изследване.\n      Macintosh: Икона на контролния център: 🟰 > Фокус > Не безпокойте\n     ⊞ Windows: Старт  > Настройки  > Система  > Известия > Не безпокойте",
