    "zh-HK":
      "請勿打擾。避免不必要的聲音和乾擾本研究。\n      Macintosh：控制中心圖示：🟰 > 焦點 > 請勿打擾\n     ⊞ Windows：開始 > 設定 > 系統 > 通知 > 請勿打擾",
    hr: "NE OMETAJ. Izbjegavajte neželjene zvukove i ometanje ove studije.\n      Macintosh: ikona Kontrolnog centra: 🟰 > Fokus > Ne uznemiravaj\n     ⊞ Windows: Start  > Postavke  > Sustav  > Obavijesti > Ne uznemiravaj",
    cs: "NERUŠIT. Vyhněte se nežádoucím zvukům a přerušení tohoto studia.\n      Macintosh: Ikona Control Center: 🟰 > Focus > Do Not Disturb\n     ⊞ Windows: Start  > Nastavení  > Systém  > Oznámení > Nerušit",
    da: "FORORD IKKE. Undgå uønskede lyde og afbrydelse af denne undersøgelse.\n      Macintosh: Kontrolcenter-ikon: 🟰 > Fokus > Forstyr ikke\n     ⊞ Windows: Start  > Indstillinger  > System  > Meddelelser > Forstyr ikke",
    nl: "NIET STOREN. Vermijd ongewenste geluiden en onderbrekingen van dit onderzoek.\n      Macintosh: Pictogram Controlecentrum: 🟰 > Focus > Niet storen\n     ⊞ Windows: Start  > Instellingen  > Systeem  > Meldingen > Niet storen",
    "en-UK":
      "DO NOT DISTURB. Avoid unwanted sounds and interruption of this study.\n      Macintosh: Control Centre icon: 🟰 > Focus > Do Not Disturb\n     ⊞ Windows: Start  > Settings  > System  > Notifications > Do not disturb",
    fi: "EI SAA HÄIRITÄ. Vältä ei-toivottuja ääniä ja tämän tutkimuksen keskeyttämistä.\n      Macintosh: Ohjauskeskuksen kuvake: 🰰 > Tarkenna > Älä häiritse\n     ⊞ Windows: Käynnistä  > Asetukset  > Järjestelmä  > Ilmoitukset > Älä häiritse",
    fr: "NE PAS DÉRANGER. Évitez les sons indésirables et l'interruption de cette étude.  \n      Macintosh : Icône du Centre de contrôle : 🟰 > Concentration > Ne pas déranger  \n     ⊞ Windows : Démarrer > Paramètres > Système > Notifications > Ne pas déranger",
    de: "BITTE NICHT STÖREN. Vermeiden Sie unerwünschte Geräusche und Unterbrechungen dieser Studie.\n      Macintosh: Kontrollzentrum-Symbol: 🟰 > Fokus > Nicht stören\n     ⊞ Windows: Start  > Einstellungen  > System  > Benachrichtigungen > Nicht stören",
    el: "ΜΗΝ ΕΝΟΧΛΕΙΤΕ. Αποφύγετε τους ανεπιθύμητους ήχους και τη διακοπή αυτής της μελέτης.\n      Macintosh: Εικονίδιο Κέντρου Ελέγχου: > Εστίαση > Μην ενοχλείτε\n     ⊞ Windows: Έναρξη  > Ρυθμίσεις  > Σύστημα  > Ειδοποιήσεις > Μην ενοχλείτε",
    he: "אל תפריע. הימנע מצלילים לא רצויים והפרעות למחקר זה.\n      Macintosh: סמל מרכז הבקרה: 🰰 > פוקוס > נא לא להפריע\n     ⊞ Windows: התחל  > הגדרות  > מערכת  > התראות > אל תפריע",
    hi: "परेशान मत करो. इस अध्ययन में अवांछित ध्वनियों और रुकावट से बचें।\n      मैकिंटोश: नियंत्रण केंद्र आइकन: 🟰 > फोकस > परेशान न करें\n     ⊞ विंडोज़: प्रारंभ > सेटिंग्स > सिस्टम > सूचनाएं > परेशान न करें",
    hu: "NE ZAVARJON. Kerülje el a nem kívánt hangokat és a tanulmány megszakítását.\n      Macintosh: Vezérlőközpont ikon: 🰰 > Fókusz > Ne zavarjanak\n     ⊞ Windows: Start  > Beállítások  > Rendszer  > Értesítések > Ne zavarjanak",
    is: "EKKI trufla. Forðastu óæskileg hljóð og truflun á þessari rannsókn.\n      Macintosh: Tákn stjórnstöðvar: 🰰 > Fókus > Ekki trufla\n     ⊞ Windows: Byrja  > Stillingar  > Kerfi  > Tilkynningar > Ekki trufla",
    id: "JANGAN GANGGU. Hindari suara-suara yang tidak diinginkan dan gangguan pada penelitian ini.\n      Macintosh: Ikon Pusat Kontrol: 🟰 > Fokus > Jangan Ganggu\n     ⊞ Windows: Mulai  > Pengaturan  > Sistem  > Pemberitahuan > Jangan ganggu",
    it: "NON DISTURBARE. Evita suoni indesiderati e interruzioni di questo studio.\n      Macintosh: Icona Centro di Controllo: 🟰 > Focus > Non disturbare\n     ⊞ Windows: Start > Impostazioni > Sistema > Notifiche > Non disturbare",
    ja: "邪魔しないでください。不要な音や研究の中断を避けてください。\n      Macintosh: コントロール センター アイコン: 🟰 > フォーカス > サイレント\n     ⊞ Windows: [スタート] > [設定] > [システム] > [通知] > [サイレント モード]",
    kn: "ಅಡಚಣೆ ಮಾಡಬೇಡಿ. ಅನಗತ್ಯ ಶಬ್ದಗಳು ಮತ್ತು ಈ ಅಧ್ಯಯನದ ಅಡಚಣೆಯನ್ನು ತಪ್ಪಿಸಿ.\n      ಮ್ಯಾಕಿಂತೋಷ್: ನಿಯಂತ್ರಣ ಕೇಂದ್ರ ಐಕಾನ್: 🟰 > ಫೋಕಸ್ > ಅಡಚಣೆ ಮಾಡಬೇಡಿ\n     ⊞ ವಿಂಡೋಸ್: ಸ್ಟಾರ್ಟ್  > ಸೆಟ್ಟಿಂಗ್‌ಗಳು  > ಸಿಸ್ಟಮ್  > ಅಧಿಸೂಚನೆಗಳು > ಅಡಚಣೆ ಮಾಡಬೇಡಿ",
    ko: "방해하지 마세요. 원치 않는 소리와 연구 중단을 피하십시오.\n      Macintosh: 제어 센터 아이콘: 🟰 > 집중 > 방해 금지 모드\n     ⊞ Windows: 시작  > 설정  > 시스템  > 알림 > 방해 금지",
    lt: "NETRUKDYKITE. Venkite nepageidaujamų garsų ir šio tyrimo nutraukimo.\n      „Macintosh“: Valdymo centro piktograma: 🰰 > Fokusuoti > Netrukdyti\n     ⊞ „Windows“: Pradėti  > Nustatymai  > Sistema  > Pranešimai > Netrukdyti",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "ശല്യപ്പെടുത്തരുത്. അനാവശ്യ ശബ്ദങ്ങളും ഈ പഠനത്തിൻ്റെ തടസ്സവും ഒഴിവാക്കുക.\n      മാക്കിൻ്റോഷ്: നിയന്ത്രണ കേന്ദ്ര ഐക്കൺ: 🟰 > ഫോക്കസ് > ശല്യപ്പെടുത്തരുത്\n     ⊞ വിൻഡോസ്: ആരംഭിക്കുക  > ക്രമീകരണങ്ങൾ  > സിസ്റ്റം  > അറിയിപ്പുകൾ > ശല്യപ്പെടുത്തരുത്",
    no: "IKKE FORORD. Unngå uønskede lyder og avbrudd i denne studien.\n      Macintosh: Kontrollsenter-ikon: 🟰 > Fokus > Ikke forstyrr\n     ⊞ Windows: Start  > Innstillinger  > System  > Varsler > Ikke forstyrr",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "NIE PRZESZKADZAĆ. Unikaj niepożądanych dźwięków i przerywania tego badania.\n      Macintosh: Ikona Centrum sterowania: 🟰 > Skupienie > Nie przeszkadzać\n     ⊞ Windows: Start  > Ustawienia  > System  > Powiadomienia > Nie przeszkadzać",
    pt: "NÃO INCOMODAR. Evite sons indesejados e interrupção deste estudo.\n      Macintosh: ícone do Centro de Controle: 🟰 > Foco > Não perturbe\n     ⊞ Windows: Iniciar  > Configurações  > Sistema  > Notificações > Não perturbe",
