    sw: "Ili kurekebisha vipaza sauti vyako unahitaji simu mahiri ambayo maikrofoni iko kwenye maktaba ya wasifu. Hopefully ni yako. Unaweza kujaribu simu mahiri moja baada ya nyingine ili kupata moja iliyo kwenye maktaba. \n",
    sv: "För att kalibrera dina högtalare behöver du en smartphone vars mikrofon finns i profilbiblioteket. Förhoppningsvis är din det. Du kan prova en smartphone efter den andra för att hitta en som finns i biblioteket. \n",
