    tr: "Hoparlörlerinizi kalibre etmek için mikrofonu profil kitaplığında bulunan bir akıllı telefona ihtiyacınız vardır. Umarım seninki öyledir. Kütüphanede bulunan bir akıllı telefonu bulmak için birbiri ardına deneyebilirsiniz. \n",
    ur: "اپنے لاؤڈ اسپیکرز کیلیبریٹ کرنے کے لیے آپ کو ایک اسمارٹ فون کی ضرورت ہے جس کا مائکروفون پروفائل لائبریری میں ہو۔ امید ہے آپ کا ہے۔ آپ لائبریری میں موجود اسمارٹ فون کو تلاش کرنے کے لیے ایک کے بعد ایک اسمارٹ فون آزما سکتے ہیں۔ \n",
