      "To produce accurate sounds, we need to calibrate the loudspeakers. This requires a calibrated microphone. Do you have a smartphone (or USB microphone) handy? \n",
    ar: "لإنتاج أصوات دقيقة، نحتاج إلى معايرة مكبرات الصوت. يتطلب ذلك ميكروفونًا معايرًا. هل لديك هاتف ذكي (أو ميكروفون USB) في متناول اليد؟",
    hy: "Ճշգրիտ ձայներ արտադրելու համար մենք պետք է չափորոշենք բարձրախոսները: Սա պահանջում է տրամաչափված խոսափող: Ձեռքի տակ ունե՞ք սմարթֆոն (կամ USB խոսափող): \n",
    bg: "За да произвеждаме точни звуци, трябва да калибрираме високоговорителите. Това изисква калибриран микрофон. Имате ли смартфон (или USB микрофон) под ръка? \n",
    "zh-CN":
      "为了产生准确的声音，我们需要校准扬声器。这需要一个经过校准的麦克风。您手边有智能手机（或 USB 麦克风）吗？ \n",
    "zh-HK":
      "為了產生準確的聲音，我們需要校準揚聲器。這需要一個經過校準的麥克風。您手邊有智慧型手機（或 USB 麥克風）嗎？ \n",
    hr: "Kako bismo proizveli točne zvukove, moramo kalibrirati zvučnike. Ovo zahtijeva kalibrirani mikrofon. Imate li pametni telefon (ili USB mikrofon) pri ruci? \n",
    cs: "Abychom produkovali přesný zvuk, musíme reproduktory kalibrovat. To vyžaduje kalibrovaný mikrofon. Máte po ruce chytrý telefon (nebo USB mikrofon)? \n",
    da: "For at producere nøjagtige lyde skal vi kalibrere højttalerne. Dette kræver en kalibreret mikrofon. Har du en smartphone (eller USB-mikrofon) ved hånden? \n",
    nl: "Om nauwkeurige geluiden te produceren, moeten we de luidsprekers kalibreren. Hiervoor is een gekalibreerde microfoon vereist. Heb je een smartphone (of USB-microfoon) bij de hand? \n",
    "en-UK":
      "To produce accurate sounds, we need to calibrate the loudspeakers. This requires a calibrated microphone. Do you have a smartphone (or USB microphone) to hand?",
    fi: "Jotta voimme tuottaa tarkkoja ääniä, meidän on kalibroitava kaiuttimet. Tämä vaatii kalibroidun mikrofonin. Onko sinulla älypuhelin (tai USB-mikrofoni) käden ulottuvilla? \n",
    fr: "Pour produire des sons précis, nous devons calibrer les haut-parleurs. Cela nécessite un microphone calibré. Avez-vous un smartphone (ou un microphone USB) à portée de main ?",
    de: "Um präzise Klänge zu erzeugen, müssen wir die Lautsprecher kalibrieren. Hierzu ist ein kalibriertes Mikrofon erforderlich. Haben Sie ein Smartphone (oder ein USB-Mikrofon) zur Hand? \n",
    el: "Για να παράγουμε ακριβείς ήχους, πρέπει να βαθμονομήσουμε τα μεγάφωνα. Αυτό απαιτεί ένα βαθμονομημένο μικρόφωνο. Έχετε εύχρηστο smartphone (ή μικρόφωνο USB); \n",
    he: "כדי להפיק צלילים מדויקים, עלינו לכייל את הרמקולים. זה דורש מיקרופון מכויל. האם יש לך סמארטפון (או מיקרופון USB) בהישג יד? \n",
    hi: "सटीक ध्वनि उत्पन्न करने के लिए, हमें लाउडस्पीकरों को कैलिब्रेट करने की आवश्यकता है। इसके लिए एक कैलिब्रेटेड माइक्रोफ़ोन की आवश्यकता होती है. क्या आपके पास स्मार्टफोन (या यूएसबी माइक्रोफोन) है? \n",
    hu: "A pontos hangzás érdekében kalibrálni kell a hangszórókat. Ehhez kalibrált mikrofonra van szükség. Van kéznél egy okostelefon (vagy USB-mikrofon)? \n",
    is: "Til að framleiða nákvæm hljóð þurfum við að kvarða hátalarana. Þetta krefst kvarðaðs hljóðnema. Ertu með snjallsíma (eða USB hljóðnema) við höndina? \n",
    id: "Untuk menghasilkan suara yang akurat, kita perlu mengkalibrasi pengeras suara. Ini memerlukan mikrofon yang dikalibrasi. Apakah Anda memiliki ponsel cerdas (atau mikrofon USB)? \n",
    it: "Per produrre suoni accurati, dobbiamo calibrare gli altoparlanti. Questo richiede un microfono calibrato. Hai uno smartphone (o un microfono USB) a portata di mano?",
    ja: "正確なサウンドを生成するには、スピーカーを調整する必要があります。これには、調整されたマイクが必要です。スマートフォン（またはUSBマイク）は手元にありますか？ \n",
    kn: "ನಿಖರವಾದ ಶಬ್ದಗಳನ್ನು ಉತ್ಪಾದಿಸಲು, ನಾವು ಧ್ವನಿವರ್ಧಕಗಳನ್ನು ಮಾಪನಾಂಕ ನಿರ್ಣಯಿಸಬೇಕಾಗಿದೆ. ಇದಕ್ಕೆ ಕ್ಯಾಲಿಬ್ರೇಟೆಡ್ ಮೈಕ್ರೊಫೋನ್ ಅಗತ್ಯವಿದೆ. ನೀವು ಸ್ಮಾರ್ಟ್‌ಫೋನ್ (ಅಥವಾ USB ಮೈಕ್ರೊಫೋನ್) ಹೊಂದಿದ್ದೀರಾ? \n",
    ko: "정확한 소리를 생성하려면 스피커를 보정해야 합니다. 이를 위해서는 보정된 마이크가 필요합니다. 스마트폰(또는 USB 마이크)을 가까이에 갖고 계십니까? \n",
    lt: "Norėdami skleisti tikslius garsus, turime sukalibruoti garsiakalbius. Tam reikalingas kalibruotas mikrofonas. Ar turite išmanųjį telefoną (arba USB mikrofoną) po ranka? \n",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "കൃത്യമായ ശബ്‌ദങ്ങൾ പുറപ്പെടുവിക്കുന്നതിന്, ഞങ്ങൾ ഉച്ചഭാഷിണികൾ കാലിബ്രേറ്റ് ചെയ്യേണ്ടതുണ്ട്. ഇതിന് കാലിബ്രേറ്റ് ചെയ്ത മൈക്രോഫോൺ ആവശ്യമാണ്. നിങ്ങളുടെ കയ്യിൽ ഒരു സ്മാർട്ട്ഫോൺ (അല്ലെങ്കിൽ USB മൈക്രോഫോൺ) ഉണ്ടോ? \n",
    no: "For å produsere nøyaktige lyder må vi kalibrere høyttalerne. Dette krever en kalibrert mikrofon. Har du en smarttelefon (eller USB-mikrofon) tilgjengelig? \n",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Aby uzyskać dokładny dźwięk, musimy skalibrować głośniki. Wymaga to skalibrowanego mikrofonu. Czy masz pod ręką smartfon (lub mikrofon USB)? \n",
    pt: "Para produzir sons precisos, precisamos calibrar os alto-falantes. Isso requer um microfone calibrado. Você tem um smartphone (ou microfone USB) em mãos? \n",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Para producir sonidos precisos, necesitamos calibrar los altavoces. Esto requiere un micrófono calibrado. ¿Tienes un teléfono inteligente (o un micrófono USB) a mano?",
    sw: "Ili kutoa sauti sahihi, tunahitaji kurekebisha vipaza sauti. Hii inahitaji maikrofoni iliyorekebishwa. Je, una simu mahiri (au USB kipaza sauti) inayoweza kukusaidia? \n",
    sv: "För att producera korrekta ljud måste vi kalibrera högtalarna. Detta kräver en kalibrerad mikrofon. Har du en smartphone (eller USB-mikrofon) till hands? \n",
