    fr: "✋ Ce clavier sera activé lorsque la distance de vision souhaitée dépassera 111 cm. D'ici là, utilisez le clavier de votre ordinateur.",
    de: "✋ Diese Tastatur wird aktiviert, wenn der gewünschte Betrachtungsabstand 111 cm überschreitet. Benutzen Sie bis dahin die Tastatur Ihres Computers.",
    el: "✋ Αυτό το πληκτρολόγιο θα ενεργοποιηθεί όταν η επιθυμητή απόσταση θέασης υπερβαίνει τα 111 cm. Μέχρι τότε, χρησιμοποιήστε το πληκτρολόγιο του υπολογιστή σας.",
