    ml: "✋ ആവശ്യമുള്ള കാഴ്ച ദൂരം 111 സെൻ്റിമീറ്ററിൽ കൂടുതലാകുമ്പോൾ ഈ കീപാഡ് പ്രവർത്തനക്ഷമമാകും. അതുവരെ നിങ്ങളുടെ കമ്പ്യൂട്ടറിൻ്റെ കീബോർഡ് ഉപയോഗിക്കുക.",
    no: "✋ Dette tastaturet vil bli aktivert når ønsket visningsavstand overstiger 111 cm. Inntil da, bruk datamaskinens tastatur.",
