    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "✋ Este teclado se habilitará cuando la distancia de visualización deseada supere los 111 cm. Hasta entonces, use el teclado de su computadora.",
