    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "En cada prueba, mientras miras la cruz, un par de líneas DESTELLARÁN en algún lugar. Tal vez donde estás mirando; tal vez en el rabillo del ojo. Solo un destello. Para aprender la tarea, probémoslo primero con una pantalla ESTÁTICA. Mientras miras la cruz, abajo, sin mover los ojos: ¿La línea superior está desplazada a la izquierda o a la derecha, en relación con la línea inferior?\n\n              +               |\n                                |\n\nEstá desplazada a la izquierda. Esta pantalla es estática, por lo que sería fácil mover los ojos hacia las líneas y decir el desplazamiento. Pero, en una prueba real, las líneas DESTELLAN, por lo que no hay tiempo para mover los ojos. Es importante mirar la cruz al iniciar cada prueba. Las líneas destellarán inmediatamente. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.",
