    lt: "Pasiruošę? Naudokite žymeklį, kad stebėtumėte kryžiaus centrą, kol pasirodys taikinys. Kryžius tampa paryškintas, kai ant jo yra žymeklis.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "തയ്യാറാണോ? ലക്ഷ്യം ദൃശ്യമാകുന്നതുവരെ ക്രോസിൻ്റെ മധ്യഭാഗം ട്രാക്ക് ചെയ്യാൻ കഴ്സർ ഉപയോഗിക്കുക. കഴ്‌സർ ഉള്ളപ്പോൾ കുരിശ് ബോൾഡ് ആയി മാറുന്നു.",
    no: "Ferdig? Bruk markøren til å spore midten av korset til målet vises. Korset blir fet når markøren er på det.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Gotowy? Użyj kursora, aby śledzić środek krzyża, aż pojawi się cel. Krzyż staje się pogrubiony, gdy znajduje się na nim kursor.",
