    id: "Halo. Anda dapat menguji apakah suara komputer ini berfungsi dengan mengklik tombol BIP. Anda akan mendengar bunyi bip seperti itu setiap kali jawaban Anda benar. ",
    it: "Ciao. Puoi verificare se il suono di questo computer funziona cliccando il pulsante BEEP. Sentirai un beep come quello ogni volta che la tua risposta è corretta.",
    ja: "こんにちは。 BEEP ボタンをクリックすると、このコンピュータのサウンドが動作しているかどうかをテストできます。答えが正解になるたびに、このようなビープ音が聞こえます。 ",
    kn: "ನಮಸ್ಕಾರ. BEEP ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ಈ ಕಂಪ್ಯೂಟರ್‌ನ ಧ್ವನಿ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿದೆಯೇ ಎಂದು ನೀವು ಪರೀಕ್ಷಿಸಬಹುದು. ಪ್ರತಿ ಬಾರಿ ನಿಮ್ಮ ಉತ್ತರ ಸರಿಯಾಗಿದ್ದರೆ ನೀವು ಅಂತಹ ಬೀಪ್ ಅನ್ನು ಕೇಳುತ್ತೀರಿ. ",
    ko: "안녕하세요. BEEP 버튼을 클릭하면 이 컴퓨터의 소리가 작동하는지 테스트할 수 있습니다. 대답이 맞을 때마다 그런 경고음이 들립니다. ",
    lt: "Sveiki. Galite patikrinti, ar šio kompiuterio garsas veikia, spustelėję mygtuką BEEP. Tokį pyptelėjimą išgirsite kiekvieną kartą, kai atsakysite teisingai. ",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "ഹലോ. BEEP ബട്ടണിൽ ക്ലിക്ക് ചെയ്ത് ഈ കമ്പ്യൂട്ടറിൻ്റെ ശബ്ദം പ്രവർത്തിക്കുന്നുണ്ടോ എന്ന് നിങ്ങൾക്ക് പരിശോധിക്കാം. നിങ്ങളുടെ ഉത്തരം ശരിയാകുമ്പോഴെല്ലാം അത്തരത്തിലുള്ള ഒരു ബീപ്പ് നിങ്ങൾ കേൾക്കും. ",
